def solve():
    n = int(input())
    edges = []
    for _ in range(n - 1):
        u, v = map(int, input().split())
        edges.append((u, v))

    adj = [[] for _ in range(n + 1)]
    for u, v in edges:
        adj[u].append(v)

    def find_max_leaf(node, parent, max_leaf):
        if len(adj[node]) == 1 and node != 1:
            return node

        max_val = -1
        for child in adj[node]:
            if child != parent:
                max_val = max(max_val, find_max_leaf(child, node, max_leaf))

        if max_val == -1:
            return node

        max_leaf[node] = max(max_leaf[node], max_val)
        return max_leaf[node]

    def find_min_leaf(node, parent, min_leaf):
        if len(adj[node]) == 1 and node != 1:
            return node

        min_val = float('inf')
        for child in adj[node]:
            if child != parent:
                min_val = min(min_val, find_min_leaf(child, node, min_leaf))

        if min_val == float('inf'):
            return node

        min_leaf[node] = min(min_leaf[node], min_val)
        return min_leaf[node]

    max_leaf = [0] * (n + 1)
    min_leaf = [0] * (n + 1)

    find_max_leaf(1, -1, max_leaf)
    find_min_leaf(1, -1, min_leaf)

    print(max_leaf[1], min_leaf[1])

