                    min_rows = i + 1
                    break
                b = mirror(b)
        return min_rows

    def mirror(b):
        c = [[0] * m for _ in range(n)]
        for i in range(n // 2):
            for j in range(m):
                c[i][j] = b[n - i - 1][j]
        return c

    print(find_min_rows(a))

