    n = int(input())
    s = []
    for _ in range(n):
        a, b = map(int, input().split())
        s.append((a, b))

    def is_good(seq):
        first_sorted = sorted([x[0] for x in seq])
        second_sorted = sorted([x[1] for x in seq])

        return first_sorted == sorted(list(range(1, n + 1))) and second_sorted == sorted(list(range(1, n + 1)))

    def count_good_permutations(seq):
        n = len(seq)
        count = 0
        for i in range(n):
            for j in range(i + 1, n):
                for k in range(j + 1, n):
                    for l in range(k + 1, n):
                        for m in range(l + 1, n):
                            for p in range(m + 1, n):
                                for q in range(p + 1, n):
                                    for r in range(q + 1, n):
                                        for t in range(r + 1, n):
                                            perm = [0] * n
                                            perm[i] = j
                                            perm[j] = k
                                            perm[k] = l
                                            perm[l] = m
                                            perm[m] = p
                                            perm[p] = q
                                            perm[q] = r
                                            perm[r] = t
                                            perm[t] = n

                                            new_seq = []
                                            for i in range(n):
                                                new_seq.append(seq[perm[i]])

                                            if is_good(new_seq):
                                                count += 1
        return count

    print(count_good_permutations(s))

