        if len(graph) > 2:
            return False

        for u in graph:
            for v in graph:
                if u != v:
                    if not is_connected(u, v, graph):
                        return False
        return True

    def is_connected(u, v, graph):
        if u not in graph or v not in graph:
            return False

        if u == v:
            return True

        if u > v:
            u, v = v, u

        if u > v:
            return False

        if u == v:
            return True

        if u in graph[v]:
