    start_word = dictionary[0]
    end_word = dictionary[1]

    def is_valid_word(word):
        return word in dictionary

    def get_neighbors(word):
        neighbors = []
        for i in range(len(word)):
            for char_code in range(ord('A'), ord('Z') + 1):
                new_word = word[:i] + chr(char_code) + word[i+1:]
                if is_valid_word(new_word):
                    neighbors.append(new_word)
        return neighbors

    def find_shortest_path(start, end, added_word):
        if start == end:
            return 0

        queue = [(start, 0)]
        visited = {start}

        while queue:
            current_word, steps = queue.pop(0)

            if current_word == end:
                return steps

            for neighbor in get_neighbors(current_word):
                if neighbor not in visited:
                    visited.add(neighbor)
                    queue.append((neighbor, steps + 1))

        return -1

    added_word = None
    min_steps = float('inf')

    for word in dictionary:
        if word != start_word and word != end_word:
            steps = find_shortest_path(start_word, end_word, word)
            if steps != -1 and steps < min_steps:
                min_steps = steps
                added_word = word
            elif steps == -1 and min_steps == float('inf'):
                min_steps = 0
                added_word = word

    if added_word is None:
        print(0)
        print(-1)
    else:
        print(added_word)
        print(min_steps)

