def solve():
    n, k = map(int, input().split())
    s = input()

    def calculate_cost(subsequence):
        cost = 0
        for char in subsequence:
            cost += 1
        return cost

    def generate_subsequences(s, current_subsequence, current_cost):
        if len(current_subsequence) == k:
            return [current_subsequence]

        subsequences = []
        for i in range(len(s)):
            new_subsequence = current_subsequence + s[i:]
            new_cost = current_cost + calculate_cost(new_subsequence)
            if new_cost <= k:
                subsequences.extend(generate_subsequences(s[i+1:], new_subsequence, new_cost))

        return subsequences

    subsequences = generate_subsequences(s, "", 0)

    if not subsequences:
        print(-1)
        return

    min_cost = float('inf')
    for subsequence in subsequences:
        cost = calculate_cost(subsequence)
        if cost < min_cost:
            min_cost = cost

    print(min_cost)

solve()

