def solve_good_number(n):
    """
    Finds the smallest good number greater than or equal to n.
    A good number is a positive integer that can be represented as a sum of distinct powers of 3.
    """
    if n == 1:
        return 1

    max_power = 0
    while (3 ** (max_power + 1)) - 1 <= n:
        max_power += 1

    max_power = min(max_power, 63)  # 63 is the maximum possible power of 3

    good_number = 0
    for i in range(max_power, -1, -1):
        if (3 ** i) <= n:
            good_number += 3 ** i
        else:
            break

    return good_number

